export default class CalendarDay {
    constructor(id, stringDay, dayOfWeek, dayOfMonth, month) {
        this.id = id;
        this.stringDay = stringDay;
        this.dayOfWeek = dayOfWeek;
        this.dayOfMonth = dayOfMonth;
        this.month = month;
    }
}
